import React from 'react';
import "../css/HubProject.css";
import "../../App.css"

function HubProject() {

    return (

        <>
        <div className="hub-container1" >
        </div>
        <div className="hub-container2" >

            <h1>Hello</h1>
            <p>YYC Hub was a project that myself and my team won Second place 
            at the YYC Hacks Hackathon. Click here to see the links.
            YYC Hub was an MVP wireframe of an event-based interactive map 
            focused on hyper-localism that links directly to apartment websites.
            As more apartment buildings sign up for YYC Hub, the Hub expands, 
            creating a larger event radius.</p>
        </div>
        </>
    )

}

export default HubProject;
